import React from 'react';
import './Contact.css';

function Contact() {
    return (
        <div className="contact-wrapper">
            <div className="contact-container glassy">
                <h1>Contact Us</h1>
                <p>If you have any questions or need assistance, feel free to reach out to us!</p>
                <div className="contact-details">
                    <p><strong>Email:</strong> support@educonnect.com</p>
                    <p><strong>Phone:</strong> +1 (123) 456-7890</p>
                    <p><strong>Follow Us:</strong></p>
                    <div className="social-links">
                        <a href="https://www.facebook.com/educonnect" target="_blank" rel="noopener noreferrer">Facebook</a>
                        <a href="https://www.twitter.com/educonnect" target="_blank" rel="noopener noreferrer">Twitter</a>
                        <a href="https://www.linkedin.com/company/educonnect" target="_blank" rel="noopener noreferrer">LinkedIn</a>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Contact;
